import React from "react";
import classes from "./Header.module.css";

import mealsImage from "../Images/meals.jpg";

const Header = (props) => {
  return (
    <>
      <header className={classes.header}>
        <h1>ReactMeals</h1>
        <button>Cart</button>
      </header>
      <div>
        <img src={mealsImage} alt="meals" />
      </div>
    </>
  );
};

export default Header;
